import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import myImg from "../../Assets/avatar.svg";
import Tilt from "react-parallax-tilt";
import {
  AiFillGithub,
  AiOutlineTwitter,
  AiFillInstagram,
} from "react-icons/ai";
import { FaLinkedinIn } from "react-icons/fa";
import catBull from "../../Assets/realcatbull.png";
import piechart from "../../Assets/piechart.png"


function Home5() {
  return (
    <Container fluid className="home-section" id="home">

        <Container className="home-content">
          <Row>
            <Col md={7} className="home-header">
              {/* <h1 style={{ paddingBottom: 15 }} className="heading">
                Hi There!{" "}
                <span className="wave" role="img" aria-labelledby="wave">
                  üëãüèª
                </span>
              </h1> */}

              <h1 className="heading" style ={{ paddingTop: 50 }}>
                Standing Cat
                <strong className="main-name"> *STD*</strong>
              </h1>

              <h1 className="heading-name" style ={{ paddingTop: 50 }}>
                Lmao the cat is standing lmfao look at the cat that's standing it's funny cuz cats can't stand
              </h1>

              {/* <div style={{ padding: 60, textAlign: "left" }}>
                <Type />
              </div> */}
            </Col>

            <Col md={5} style={{ paddingLeft: 200, paddingTop: 50, paddingBottom: 5 }}>
              <img
                // src={homeLogo}
                src={piechart}
                alt="home pic"
                className="img-fluid"
                // style={{ maxHeight: "450px" }}
              />
            </Col>
          </Row>
        </Container>
      </Container>
  );
}
export default Home5;
